import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View, Image } from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>
      <FilmPoster_comp></FilmPoster_comp>
    </View>
  );
}

const styles = StyleSheet.create({

  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});

const FilmPoster_comp = (array :  string) => {
  const filmPoster_array  = [
    { url: "https://m.media-amazon.com/images/M/MV5BN2EyZjM3NzUtNWUzMi00MTgxLWI0NTctMzY4M2VlOTdjZWRiXkEyXkFqcGdeQXVyNDUzOTQ5MjY@._V1_.jpg", 
    title: "LOTR - The fellowship of the ring ", year: "2000"},
    { url: "https://occ-0-987-2705.1.nflxso.net/dnm/api/v6/X194eJsgWBDE2aQbaNdmCXGUP-Y/AAAABY5_5KQ4JY_jRh_eCFCm_Nyv3lyuIOVWL0TCPj6VxZKqFiH7h5Nc3-NB0Zl8CQOorMrcTTbZbzoFKUxs_83IiHfJiNe-PjQYpxhD.jpg?r=df6", 
    title: "LOTR - The Two Towers" , year: "2000"},
    { url: "LOTR - The return of th king ", 
    title: "https://m.media-amazon.com/images/M/MV5BNzA5ZDNlZWMtM2NhNS00NDJjLTk4NDItYTRmY2EwMWZlMTY3XkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_.jpg" , year: "2000"},
    { url: "https://upload.wikimedia.org/wikipedia/en/f/f3/Spider-Man2002Poster.jpg", 
    title: "Spider man 1" , year: "2000"},
    { url: "https://prod-ripcut-delivery.disney-plus.net/v1/variant/disney/BB98484FAF58CD987B8DFE4BB930C2CA91262B2045E59CE34534DB345DE9BEF8/scale?width=1200&aspectRatio=1.78&format=jpeg",
     title: "Spider man 2" , year: "2000"},
    { url: "https://media.s-bol.com/3wVWYRg603xr/550x702.jpg", 
    title: "Spider-man 3" , year: "2000"},
  ];

  return(
    <div>
      {
        filmPoster_array.map((index) => {
          <Image source={index.url}></Image>
        })
      }
    </div>

  );
}
